    private async Task CreateHandlerFC(GridCommandEventArgs args)
    {
        AssessmentFC item = (AssessmentFC)args.Item;
        var C = GridINFC.ToList();
        
        if (item.Financial==0) {
            C.RemoveAll(r=>r.Id==3);
        }
